import React from 'react'
function Home() {
    const box={
        width:'70%',
        height:'80vh',
        backgroundColor:'#fff',
        position:'absolute',
        top:'100px',
        marginRight:'15%',
        marginLeft:'15%', 
        boxShadow:'0px 5px 15px black',
    }
    const text = {
        fontSize:'2.5rem',
        marginLeft:'20px'
    }
    const para={
        fontWeight:'bold',
        fontSize:'18px'
    }
return (
        <div>
           <div style={box}>
            <h1 style={text}>UPLOAD IMAGE</h1>
            <p style={para}>Drag And Drop Your Images Below</p>
           </div>
        </div>
    )
}
export default Home
